import Picture from './Picture';
const PictureList = (props) => {

  const results = props.data;
  let pictures = results.map((picture, index) =>
    <Picture url={picture.images.fixed_height.url} key={index} />
  )

  const styles = {
    h2: {
      textAlign: 'center'  
    },
    ul: {
      display: 'flex',
      flexWrap: 'wrap',
      listStyleType: 'none',
      margin: 'auto'
    }
  }

  return (
    <div>
    <h2>PictureList</h2>
      <ul style={styles.ul}>
        {pictures}
      </ul>
    </div>
  );
}

export default PictureList;
